import React from "react";
import { propTypes } from "react-bootstrap/esm/Image";

function descriptionText(props) {
  return (
    <div>
      <h1>{props.gameTitle}</h1>
      <h1>{props.position}</h1>
      <h1>{props.description}</h1>
    </div>
    );
}

export default descriptionText;
